import '../App.css';
import './Home.css';

export default function Home() {
  return (
    <div className="App container">
      <div className="title container">
        <h1>Cathy <br />Design <br /><p>Lab</p></h1>
      </div>
      <header className="App-header">
        {/*         <div className="videoContainer">
          <iframe src={video} clssName="IntroVideo"></iframe>
        </div> */}
        <p className="intro">Hi, I'm Cathy, UI UX Designer in Toronto. Since 2014, I started my professional career and designed digital products like mobile apps and websites with my bare hands.</p>
      </header>
    </div>
  );
}
